
CREATE TABLE arrondissement (
    id integer NOT NULL,
    geom public.geometry(MultiPolygon,2989),
    id_geofla character varying(24),
    code_arr character varying(1),
    code_chf character varying(3),
    nom_chf character varying(50),
    x_chf_lieu integer,
    y_chf_lieu integer,
    x_centroid integer,
    y_centroid integer,
    code_dept character varying(2),
    nom_dept character varying(30),
    code_reg character varying(2),
    nom_reg character varying(35)
);

